message:
💭 *Pensamento:* *DEUS* é o responsável por nos trazer ao mundo, por isso *Ele* não pode deixar que nos falte o alimento, ou qualquer outra coisa que necessitamos. Não podemos colocar nosso trabalho e nossos afazeres diários acima de *DEUS*, nossa dedicação maior deve ser buscar a *DEUS*. Se andamos ansiosos com o dia de amanhã, devemos nos arrepender pela falta de fé, e por muitas vezes desejarmos gastar nosso salário com aquilo que não é pão (Isaías 55:2), pois se somos díscipulos de *JESUS* podemos descansar e ter a certeza que *Ele* veio para que tenhamos vida e vida em abundância (João 10:10).

🙇🏻‍♀️ *Oração: Senhor* perdoa pelas vezes que deixei de coloca-lo em primeiro plano, e pelas vezes que tive medo do amanhã, de que faltasse algo para mim, e perdoa pelas vezes que fiquei ansioso sem necessidade, sendo que eu confio plenamento no *Senhor* e tenho a certeza pela fé que todas as necessidades serão supridas. Agradeço pela saúde que o *Senhor* tem me dado. Amém 🙌🏼
@Mensagensemfe
